MediaMan is the ideal software to manage your media collection. It is not only a 
powerful tool to keep a digital catalog of all your books, videos, music, and games, but also an interactive jukebox.
Featuring Amazon International importer, virtual shelf, tagging, barcode
scanner, rental management, and fully customizable user interface, this little piece of program is fully loaded but easy to use.



Clean of virusus &amp; other shit, take it or leave it - your choice.
